import "./topbar.css"

export default function Topbar() {
    return (
        <div className="top">
            <div className="topLeft">
                <i class="fab fa-facebook-square"></i>
            </div>
            <div className="topCenter">2</div>
            <div className="topRight">3</div>
        </div>
    )
}
